import { Avatar, ListItem,ListItemText } from '@material-ui/core';
import React, { useContext } from 'react'
import { Redirect } from 'react-router-dom'
import { Button, CardHeader, Col, Container, Row,Input } from 'reactstrap';
import {userContext} from './../context/context'
import { FixedSizeList } from 'react-window';
import PropTypes from 'prop-types';
import { makeStyles } from '@material-ui/core/styles';
import {FcSearch} from 'react-icons/fc'
import {IoMdPersonAdd} from 'react-icons/io'
const useStyles = makeStyles((theme) => ({
    root: {
      width: '100%',
      height: '80%',
      backgroundColor: theme.palette.background.paper,
    },
    // avatar: {
    //     backgroundColor: "red",
    //   },
  }));

  function renderRow(props) {
    const { index, style } = props;

    return (
      <ListItem button style={style} key={index}>
        {/* <ListItemText primary={`Item ${index + 1}`} /> */}

      </ListItem>
    );
  }

  renderRow.prototype = {
    index: PropTypes.number.isRequired,
    style: PropTypes.object.isRequired,
  };
export default function Home() {

    const classes = useStyles();
    const context = useContext(userContext);
    console.log(context.token);
    return (
        <div>

            {context.token ? (
                <>
                <div className="p-4">
                    <Container style={{height:"100%"}}>
                        <CardHeader style={{backgroundColor:"skyblue",color:"black"}}>
                            <div className="d-flex bd-highlight">
                                <div className=" bd-highlight">
                                    <Avatar src="https://data.apksum.com/4e/sunstarphotomedia.photobackgroundchangerpro/screenhost/1.jpg" alt="" />
                                </div>
                                <div className="d-flex align-items-center">
                                    <div className=" ml-2 bd-highlight">
                                        Gaurav Singh
                                    </div>
                                </div>
                                <div className="ml-auto d-flex align-items-center">
                                    <div className="bd-highlight">
                                        <Button className="btn btn-info">
                                            Logout
                                        </Button>
                                    </div>
                                </div>    
                            </div>    
                        </CardHeader>
                        <Row style={{borderColor:"ActiveBorder"}}>
                            <Col md={4}>
                                <CardHeader className="mt-3" style={{backgroundColor:"skyblue",color:"black"}}>
                                    <div className="d-flex bd-highlight">
                                        <div className="mr-auto bd-highlight">
                                            Friends
                                        </div>
                                        <div className="bd-highlight">
                                            <FcSearch style={{fontSize:"30"}} />
                                        </div>
                                        <div className=" ml-3 bd-highlight">
                                            <IoMdPersonAdd style={{fontSize:"30"}} />
                                        </div>
                                    </div>
                                </CardHeader>

                                <div className={classes.root}>
                                    <FixedSizeList height={400} className="form-control mt-2" itemSize={46} itemCount={200}>
                                        {renderRow}
                                    </FixedSizeList>
                                </div>
                            </Col>
                            <Col md={8}>

                            </Col>
                        </Row>
                    </Container>
                </div>

                </>
            ) : (
                <Redirect to="/" />
            )}
        </div>
    )
}
